import React from "react"

function BlogPost(props) {
    return (
        <div>
            <h1>{props.each.title}</h1>
            <h3>{props.each.subtitle}</h3>
            <p>{props.each.author}</p>
            <p>{props.each.date}</p>
        </div>
    )
}

export default BlogPost
